#!/usr/bin/env python3
import os
import json
import base64
import hashlib
import requests
from Crypto.Cipher import AES, PKCS1_OAEP
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from datetime import datetime

# === Configuration ===
SCRIPT_BASE_NAME = "IPToP_1.4"
GITHUB_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/"

# === Fonctions de d√©chiffrement ===
def decrypt_data(encrypted_data, key):
    """D√©chiffre les donn√©es avec AES-CBC"""
    try:
        encrypted_data = base64.b64decode(encrypted_data)
        iv, ct = encrypted_data[:16], encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        return unpad(cipher.decrypt(ct), AES.block_size).decode()
    except Exception as e:
        print(f"‚ùå Erreur de d√©chiffrement: {e}")
        return None

def decrypt_key_with_rsa(encrypted_key, private_key):
    """D√©chiffre une cl√© AES avec RSA"""
    return PKCS1_OAEP.new(private_key).decrypt(base64.b64decode(encrypted_key))

# === Mise √† jour ===
def check_for_updates():
    """V√©rifie les mises √† jour disponibles"""
    try:
        print("üîç V√©rification des mises √† jour...")
        response = requests.get(f"{GITHUB_URL}{SCRIPT_BASE_NAME}_encrypted.metadata.json", timeout=10)
        if response.status_code == 200:
            remote_meta = response.json()
            with open(f"{SCRIPT_BASE_NAME}_encrypted.metadata.json") as f:
                local_meta = json.load(f)
            return remote_meta["version"] > local_meta["version"]
    except Exception as e:
        print(f"‚ö†Ô∏è Erreur: {str(e)}")
    return False

def perform_update():
    """T√©l√©charge tous les fichiers n√©cessaires"""
    try:
        fichiers = [
            ("_encrypted.metadata.json", f"{SCRIPT_BASE_NAME}_encrypted.metadata.json"),
            ("_encrypted.sha256", f"{SCRIPT_BASE_NAME}_encrypted.sha256"), 
            ("_encrypted_ready_to_use.py", f"{SCRIPT_BASE_NAME}_encrypted_ready_to_use.py")
        ]
        
        for suffix, fichier in fichiers:
            print(f"‚è¨ T√©l√©chargement {fichier}...")
            response = requests.get(f"{GITHUB_URL}{SCRIPT_BASE_NAME}{suffix}", timeout=10)
            if response.status_code == 200:
                with open(fichier, 'wb') as f:
                    f.write(response.content)
        return True
    except Exception as e:
        print(f"‚ùå Erreur de mise √† jour: {str(e)}")
        return False

# === Point d'entr√©e ===
if __name__ == "__main__":
    if check_for_updates() and perform_update():
        print("üéâ Mise √† jour termin√©e - Relancez le script")
        exit()
    
    try:
        # Chargement des m√©tadonn√©es
        with open(f"{SCRIPT_BASE_NAME}_encrypted.metadata.json") as f:
            metadata = json.load(f)
        
        # V√©rification expiration
        if datetime.now() > datetime.strptime(metadata["expiration_date"], "%Y-%m-%d"):
            print("‚åõ Script expir√©")
            exit()
        
        # D√©chiffrement
        with open("private_key.pem") as f:
            private_key = RSA.import_key(f.read())
        
        decrypted_script = decrypt_data(
            """""",
            decrypt_key_with_rsa(metadata["encrypted_key"], private_key)
        )
        
        if decrypted_script:
            exec(decrypted_script)
    except Exception as e:
        print(f"‚ùå Erreur critique: {str(e)}")
